} from 'react-icons/fa';

const Footer = () => {
  let date = new Date();
  let year = date.getFullYear();

  return (
    <div className={s.footer}>
      <div className={s.container}>
        <div className={s.copyright}>
          <h3>Designed and Developed by Vatsal Kevadiya</h3>
        </div>

        <div className={s.copyright}>
          <h3>Â© {year} vatsal.dev</h3>
        </div>

        <div className={s.body}>
          <ul className={s.socialIcons}>
            <li>
              <a
                href="https://github.com/vatsalkevadiya"
                target="_blank"
